//SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

contract HTLC {
    struct Swap {
        address sender;
        address receiver;
        uint256 amount;
        uint256 timelock;
        bytes32 hashlock;
        bool withdrawn;
        bool refunded;
        bytes32 secret;
    }
    //swapID->keccak
    mapping(bytes32 => Swap) public swaps;
    //to filter
    event SwapCreated(
        bytes32 indexed swapId,
        address indexed sender,
        address indexed receiver,
        uint256 amount,
        bytes32 hashlock,
        uint256 timelock
    );
    event SwapWithdrawn(bytes32 indexed swapId, bytes32 secret);
    event Refunded(bytes32 indexed swapId);

    function createSwap(
        address receiver,
        bytes32 hashlock, 
        uint256 timelock
    ) external payable returns (bytes32 swapId){
        require(msg.value > 0, "no ETH sent");
        //not to black hole
        require(receiver != address(0), "Invlid receiver");
        uint256 unlockTime = block.timestamp + timelock;

        //just hash 
        swapId = keccak256(abi.encodePacked(msg.sender, receiver, msg.value, hashlock, unlockTime, block.number));
        require(swaps[swapId].sender == address(0), "Swap already exists");

        //swap details msg - who is calling the func 
        swaps[swapId] = Swap({
            sender: msg.sender,
            receiver: receiver,
            amount: msg.value,
            hashlock: hashlock,
            timelock: unlockTime,
            withdrawn: false,
            refunded: false,
            secret: 0x0
        });
        emit SwapCreated(swapId, msg.sender, receiver, msg.value, hashlock, unlockTime);
    }
    function withdraw(bytes32 swapId, bytes32 secret) external {
        Swap storage s = swaps[swapId];

        require (s.receiver == msg.sender, "Not receiver");
        require(!s.withdrawn, "Already withdrawn");
        require(!s.refunded, "Already refunded");
        require(block.timestamp < s.timelock, "Timelock expired");
        require(keccak256(abi.encodePacked(secret)) == s.hashlock, "Invalid secret");

        //counts as withdrawn
        s.secret = secret;
        s.withdrawn = true;

        //sendinf the funds
        payable(s.receiver).transfer(s.amount);
        emit SwapWithdrawn(swapId, secret);
    }

    function refund(bytes32 swapId) external {
        Swap storage s = swaps[swapId];

        require (s.sender == msg.sender, "Not sender");
        require(!s.withdrawn, "Already withdrawn");
        require(!s.refunded, "Already refunded");
        require(block.timestamp < s.timelock, "Timelock expired");

        s.refunded = true;
        payable(s.sender).transfer(s.amount);
        emit Refunded(swapId);
    }
    function getSwap(bytes32 swapId) external view returns (Swap memory) {
        return swaps[swapId];
    }
}

